import './App.css';
import PersonToPerson from './pages/p_to_p'
import Home from './pages/home';
import Navbar from './components/navbar';

import { BrowserRouter, Routes, Route } from "react-router-dom";
import RoomContextProvider from './context/setRoomContext';

function App() {

  return (
    <RoomContextProvider>
    <div className="App flex justify-center">

      <Navbar/>
      <BrowserRouter>
        <Routes>
          <Route path='' Component={Home} />
          <Route path='chat' Component={PersonToPerson} />
        </Routes>
      </BrowserRouter>

    </div>
    </RoomContextProvider>
  );
}

export default App;
